import React from 'react';
const City =(props)=>{
    return(
        <div className="city">
        <img src={props.img} alt="image"/>
          <h6><ion-icon name="home-outline"></ion-icon>{props.visit}</h6>
            <br/>
            <h6><ion-icon name="home-outline"></ion-icon> {props.follow}</h6>
            <br/>
            <h6> <ion-icon name="mail-outline"></ion-icon> {props.contact} </h6>
        
    </div>
    )
}

export default City;
